import { Module } from "../../Components/ModuleSkill/moduleskill"
import { FaHtml5, FaCss3Alt, FaSass, FaBootstrap, FaGithub, FaJs, FaReact, FaPython, FaJava } from 'react-icons/fa';

export const Skills = () => {
    return(
        <>
            <Module icon={ <FaHtml5/> } title={"HTML"} percent={60}/>
        </>
    )
}

